import React from 'react'
import styled from '@emotion/styled'

const Container = styled.div`
    display: flex;
    flex-flow: column wrap;
`


const Card = ({ emoji }) => {
    return (
        <Container>
            {emoji}
        </Container>
    );
}

export default Card;
